   Inainte de Finding Nemo, Monsters Inc. si Cars, mintile pline de imaginatie de la Disney/Pixar v-au prezentat Toy Story si o lume uimitoare, unde jucariile se joaca in timp ce stapanii lor nu sunt langa ele. Redescoperiti debutul regizoral al apreciatului regizor John Lasseter, cu Woody (Tom Hanks), Buzz Lightyear (Tim Allen) si toti prietenii lor, intr-o aventura plina de umor, emotie si prietenie, o Editie Speciala pe care nu aveti voie sa o ratati!

Acest film clasic animat pe computer, care a revolutionat industria la vremea respectiva, a dat startul si a pregatit traseul pentru Toy Story 2, o productie la fel de uluitoare. Bucurati-va de toate noile materiale bonus - printre care o avanpremiera Toy Story 3, prezentand in exclusivitate urmatorul capitol din aceasta extraordinara aventura. Distractie non-stop pentru intreaga familie - si un element esential, care nu poate lipsi din colectia dumneavoastra!
